DROP TABLE IF EXISTS buku;
CREATE TABLE `buku` (
  `kode_buku` varchar(40) NOT NULL,
  `judul_buku` varchar(200) NOT NULL,
  `slug` varchar(200) NOT NULL,
  `isbn` varchar(40) DEFAULT NULL,
  `tahun_buku` varchar(40) DEFAULT NULL,
  `kode_penerbit` varchar(40) NOT NULL,
  `kode_rak` varchar(40) NOT NULL,
  `kode_jenis` varchar(40) NOT NULL,
  `halaman` int(20) NOT NULL,
  `deskripsi_buku` text NOT NULL,
  `sampul` varchar(100) NOT NULL,
  `barcode_buku` blob NOT NULL,
  PRIMARY KEY (`kode_buku`),
  KEY `kode_jenis` (`kode_jenis`),
  KEY `buku_ibfk_2` (`kode_penerbit`),
  KEY `kode_rak` (`kode_rak`),
  CONSTRAINT `buku_ibfk_1` FOREIGN KEY (`kode_jenis`) REFERENCES `jenis_buku` (`kode_jenis`) ON UPDATE CASCADE,
  CONSTRAINT `buku_ibfk_2` FOREIGN KEY (`kode_penerbit`) REFERENCES `penerbit` (`kode_penerbit`) ON UPDATE CASCADE,
  CONSTRAINT `buku_ibfk_3` FOREIGN KEY (`kode_rak`) REFERENCES `rak` (`kode_rak`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS jenis_buku;
CREATE TABLE `jenis_buku` (
  `kode_jenis` varchar(40) NOT NULL,
  `nama_jenis` varchar(100) NOT NULL,
  `kode_warna` varchar(40) NOT NULL DEFAULT '#000000',
  PRIMARY KEY (`kode_jenis`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS kelas;
CREATE TABLE `kelas` (
  `kode_kelas` varchar(40) NOT NULL,
  `nama_kelas` varchar(100) NOT NULL,
  PRIMARY KEY (`kode_kelas`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS levels;
CREATE TABLE `levels` (
  `id_level` int(11) NOT NULL AUTO_INCREMENT,
  `level` enum('admin','pustakawan') NOT NULL,
  `nama_level` varchar(100) NOT NULL,
  PRIMARY KEY (`id_level`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS penerbit;
CREATE TABLE `penerbit` (
  `kode_penerbit` varchar(40) NOT NULL,
  `nama_penerbit` varchar(100) NOT NULL,
  PRIMARY KEY (`kode_penerbit`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS pengunjung;
CREATE TABLE `pengunjung` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nis` int(40) NOT NULL,
  `waktu` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `nis` (`nis`),
  CONSTRAINT `pengunjung_ibfk_1` FOREIGN KEY (`nis`) REFERENCES `siswa` (`nis`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=44 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS perpus;
CREATE TABLE `perpus` (
  `id` int(11) NOT NULL,
  `nama_perpus` varchar(200) NOT NULL,
  `slogan_perpus` text NOT NULL,
  `peraturan_perpus` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS rak;
CREATE TABLE `rak` (
  `kode_rak` varchar(40) NOT NULL,
  `nama_rak` varchar(100) NOT NULL,
  PRIMARY KEY (`kode_rak`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS sekolah;
CREATE TABLE `sekolah` (
  `id` int(11) NOT NULL,
  `nama_sekolah` varchar(200) NOT NULL,
  `slogan_sekolah` text NOT NULL,
  `email_sekolah` varchar(100) NOT NULL,
  `alamat_sekolah` text NOT NULL,
  `logo` varchar(200) NOT NULL,
  `background` varchar(200) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS selector;
CREATE TABLE `selector` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `selector` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS set_email;
CREATE TABLE `set_email` (
  `id` int(11) NOT NULL,
  `smtp` varchar(100) NOT NULL,
  `email` varchar(100) NOT NULL,
  `password_email` varchar(200) NOT NULL,
  `port` int(20) NOT NULL,
  `nama` varchar(100) NOT NULL,
  `subject` text NOT NULL,
  `selector` varchar(20) NOT NULL,
  `message` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS set_transaksi;
CREATE TABLE `set_transaksi` (
  `id` int(11) NOT NULL,
  `terlambat` int(11) NOT NULL DEFAULT 0,
  `denda` varchar(200) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS set_whastapp;
CREATE TABLE `set_whastapp` (
  `id` int(11) NOT NULL,
  `endpoint` text NOT NULL,
  `apikey` text NOT NULL,
  `pengirim` varchar(25) NOT NULL,
  `selector` varchar(20) NOT NULL,
  `message` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS siswa;
CREATE TABLE `siswa` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nis` int(40) NOT NULL,
  `nisn` varchar(40) NOT NULL,
  `nama_siswa` varchar(40) NOT NULL,
  `kode_kelas` varchar(40) NOT NULL,
  `kode_tahun` varchar(40) NOT NULL,
  `wa` varchar(25) NOT NULL,
  `email` varchar(50) NOT NULL,
  `alamat_siswa` text NOT NULL,
  `foto` varchar(100) DEFAULT NULL,
  `barcode_siswa` blob NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `nis` (`nis`),
  UNIQUE KEY `nisn` (`nisn`),
  KEY `kode_kelas` (`kode_kelas`),
  KEY `kode_tahun` (`kode_tahun`),
  CONSTRAINT `siswa_ibfk_1` FOREIGN KEY (`kode_kelas`) REFERENCES `kelas` (`kode_kelas`) ON UPDATE CASCADE,
  CONSTRAINT `siswa_ibfk_2` FOREIGN KEY (`kode_tahun`) REFERENCES `tahun_ajaran` (`kode_tahun`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=727 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS tahun_ajaran;
CREATE TABLE `tahun_ajaran` (
  `kode_tahun` varchar(40) NOT NULL,
  `nama_tahun` varchar(100) NOT NULL,
  `aktif` date NOT NULL,
  `kadaluarsa` date NOT NULL,
  PRIMARY KEY (`kode_tahun`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS transaksi;
CREATE TABLE `transaksi` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nis` int(40) NOT NULL,
  `kode_buku` varchar(40) NOT NULL,
  `status` enum('pinjam','kembali') NOT NULL,
  `pinjam` date DEFAULT current_timestamp(),
  `kembali` date DEFAULT NULL,
  `terlambat` int(11) DEFAULT NULL,
  `denda` int(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `nis` (`nis`),
  KEY `transaksi_ibfk_1` (`kode_buku`),
  CONSTRAINT `transaksi_ibfk_1` FOREIGN KEY (`kode_buku`) REFERENCES `buku` (`kode_buku`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `transaksi_ibfk_2` FOREIGN KEY (`nis`) REFERENCES `siswa` (`nis`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
DROP TABLE IF EXISTS users;
CREATE TABLE `users` (
  `id_user` int(11) NOT NULL AUTO_INCREMENT,
  `nama_user` varchar(200) NOT NULL,
  `username` varchar(200) NOT NULL,
  `password` varchar(200) NOT NULL,
  `nomor_wa` varchar(100) NOT NULL,
  `email_user` varchar(200) NOT NULL,
  `id_level` int(11) NOT NULL,
  `alamat_user` text NOT NULL,
  `foto_user` varchar(200) NOT NULL,
  PRIMARY KEY (`id_user`),
  KEY `id_level` (`id_level`),
  CONSTRAINT `users_ibfk_1` FOREIGN KEY (`id_level`) REFERENCES `levels` (`id_level`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
